import React from "react";
import styled from "styled-components";

const Container = styled.div`
  background-color: red;
  width: 100vw;
  height: 100%;
  padding: 0px 100px;
`;

const HeaderBlock = styled.div`
  background-color: blue;
  width: 100%;
  height: 200px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const HeaderBlock_w = styled.div`
  background-color: white;
  width: 100%;
  height: 200px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

const HeaderColumn = styled.div`
  width: 50%;
  display: flex;
  flex-direction: column;
  justify-content: left;
  text-align: left;
`;

const Title = styled.span`
  color: black;
  margin-bottom: 20px;
  font-size: 30px;
  font-weight: 600;
  background-color: white;
  display: flex;
`;

const Description = styled.span`
  color: black;
  font-size: 20px;
  font-weight: 400;
  background-color: white;
  display: flex;
  justify-content: center;
`;

const CurriculumList = styled.ul`
  background-color: yellow;
  width: 100%;
  height: 500px;
  display: flex;
  flex-direction: column;
  text-align: center;
  align-items: left;
`;
const Item = styled.li`
  color: black;
`;

const HomePresenter = () => (
  <Container>
    <HeaderBlock>
      <Title>앱의 구동방식을 설계하는 단계.</Title>
      <Description>
        앱의 구동방식을 설계하는 단계. UX 디자인 과정에서는, 4주에 걸쳐 앱의
        아이디어를 정리하고 구동방식을 결정하는 것을 배웁니다.  이 과정을 통해
        개발자들은 ()를, 디자이너들은 (. )를 익힐 수 있으며, 기획자들은 (. )를
        깨닫게 됩니다.
      </Description>
    </HeaderBlock>
    <HeaderBlock_w>
      <Title>연세대 UX디자인 클래스를 1달 집중코스로 제공</Title>
      <Description>
        앱의 구동방식을 설계하는 단계. UX 디자인 과정에서는, 4주에 걸쳐 앱의
        아이디어를 정리하고 구동방식을 결정하는 것을 배웁니다.  이 과정을 통해
        개발자들은 ()를, 디자이너들은 (. )를 익힐 수 있으며, 기획자들은 (. )를
        깨닫게 됩니다.
      </Description>
    </HeaderBlock_w>
    <HeaderBlock>
      <Title>4주간 20시간 분량의 학습으로 내 앱을 디자인</Title>
      <Description>
        4주간 매주 5~ 10시간 분량의 학습 콘텐츠를 제공하고, 실시간 원격 수업을
        통해 진행상황 체크. 무료로 제공하는 동영상 콘텐츠를 미리 보고 준비해
        보자.
      </Description>
    </HeaderBlock>
    <CurriculumList>
      <Title>Data Analysis with Python and SQL</Title>
      <Description>
        Advance your programming skills and refine your ability to work with
        messy, complex datasets. You’ll learn to manipulate and prepare data for
        analysis, and create visualizations for data exploration. Finally,
        you’ll learn to use your data skills to tell a story with data.
      </Description>
      <Item>1</Item>
      <Item>2</Item>
      <Item>3</Item>
      <Item>4</Item>
    </CurriculumList>
  </Container>
);

export default HomePresenter;
